import React, { Component } from 'react';
import './App.css';
import Container from './components/Container.js'

class App extends Component {


  render() {
    return (
      <div className="App">
        <h1>Les 5 tendances de recherches google du jour.</h1>
        <Container />
      </div>
    );
  }
}

export default App;
